	add("proctocracy", "{\"term\":\"proctocracy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"First attested in March 2002; formed as {{confix|procto|cracy|t1\u003danus|t2\u003drule|lang\u003den}}; equivalent to a hypothetical Ancient greek (to 1453) etymon of the form *\u0027\u0027 (πρωκτοκρατία) from \u0027πρωκτός\u0027 (anus) + \u0027κράτος\u0027 (dominion”, “power)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"or by “” (\u0027i.e.\u0027, , or otherwise highly people\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027 March 2nd, “\u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[https://groups.google.com/groups/profile?hl\u003den\u0026amp;enc_user\u003dwz1mWQcAAACZFIAhaBVJJ2FA-xAdvdj7 ZONTAR JOHNSON]”, \u0027[https://groups.google.com/group/alt.radio.oldtime/topics?hl\u003den alt.radio.oldtime]\u0027, “[https://groups.google.com/group/alt.radio.oldtime/browse_thread/thread/bc4d80200f66d7f2/71141733f23165e1?hl\u003den\u0026amp;ie\u003dUTF-8\u0026amp;q\u003dproctocrac\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"71141733f23165e1 REQ Stoopnagle and Budd TIA]”, [https://groups.google.com/group/alt.radio.oldtime/msg/71141733f23165e1?hl\u003den\u0026amp;dmode\u003dsource\u0026amp;output\u003dgplain Message ID: \u0026lt;u7v68sdj1k6h99@corp.supernews.com\u0026gt;]\u0026lt;/span\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Come the Revolution we’ll have other Ass-holes ruling us.\u0026lt;br/\u0026gt;Long live the \u0027\u0027Proctocracy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 December 11th, “\u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[https://groups.google.com/groups/profile?hl\u003den\u0026amp;enc_user\u003dzh-kUyAAAACi9MJdcNoohzxm4k4-Z6lYBL8iTT3BFonjm0-eQ7RtCw Catherine Deschevaux]”, \u0027[https://groups.google.com/group/alt.quotations/topics?hl\u003den alt.quotations]\u0027, “[https://groups.google.com/group/alt.quotations/browse_thread/thread/57a92a1380f750ed/53ecbe4b4b1be3cc?hl\u003den\u0026amp;ie\u003dUTF-8\u0026amp;q\u003dproctocrac\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"53ecbe4b4b1be3cc Re: Privatizing -er, Profitizing War]”, [https://groups.google.com/group/alt.quotations/msg/53ecbe4b4b1be3cc?hl\u003den\u0026amp;dmode\u003dsource\u0026amp;output\u003dgplain Message ID: \u0026lt;hdmfh.6582$HU.4010@news-server.bigpond.net.au\u0026gt;]\u0026lt;/span\u0026gt;\u0026lt;!-- Responding to: “In that case, it’s time for Catherine Deschevaux to take up the cudgels.” --\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It was instinctive dealing with the US \u0027\u0027proctocracy\u0027\u0027 and its blinkered cheer-squad\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Tony Thorne, \u0027Shoot the Puppy\u0027, “\u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dnP5MhkfVHwoC\u0026amp;pg\u003dPT190\u0026amp;dq\u003dproctocracy\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d5gghT9npMcbu8QO8g6nLBw\u0026amp;ved\u003d0CDMQ6AEwA\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dproctocracy\u0026amp;f\u003dfalse proctoheliosis]\u0026lt;/span\u0026gt\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A more recent workplace use of the same root is the notion of labouring under a \u0027\u0027proctocracy\u0027\u0027\u0026lt;!-- also emboldened in the source --\u0026gt;, defined as ‘rule by assholes’\", \"priority\":10}]}, \"synonyms\":{}}");

