	add("procurator", "{\"term\":\"procurator\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"Anglo-norman \u0027procuratour\u0027 from Latin \u0027procurator\u0027 from \u0027prōcūrō\u0027 (i procure) (English \u0027procure\u0027 . Surface analysis is {{suffix|procure|ator|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tax collector\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An agent or attorney\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A legal officer who both investigates and prosecutes crimes, found in some inquisitorial legal systems, particularly communist or formerly communist states – see\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The governor of a small imperial province\", \"priority\":4}]}, \"synonyms\":{}}");

	add("procurement", "{\"term\":\"procurement\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027procurement\u0027 from \u0027procurer\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The purchasing department of a company\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of procuring or obtaining; obtainment; attainment\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He was responsible for the \u0027\u0027procurement\u0027\u0027 of materials and supplies\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I have a lot of experience in the \u0027\u0027procurement\u0027\u0027 of construction materials and sub-contracts\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Efficient contrivance; management; agency\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"They think it done by her \u0027\u0027procurement\u0027\u0027.\u0027 -Dryden\", \"priority\":6}]}, \"synonyms\":{}}");

	add("procurer", "{\"term\":\"procurer\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027procurour\u0027 Old french (842-ca. 1400) \u0027procureur\u0027 Surface etymology is {{suffix|procure|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a person who procures or obtains things, especially one who procures customers for prostitutes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("procuress", "{\"term\":\"procuress\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027procureresse\u0027 (compare French \u0027procureuse\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female procurer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1905\u0027\u0027, w:W. Somerset W. Somerset Maugham, \u0027The Land of The Blessed Virgin: Sketches and Impressions in Andalusia\u0027, \u0026quot;Puerta del Puente\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Spaniard, who will seduce any girl he can, is pitiless under like circumstances to his own womenkind; so there is much weeping, the girl is turned out of doors and falls readily into the hands of the \u0027\u0027procuress\u0027\u0027. In the brothels of Seville or of Madrid she finds at least a roof and bread to eat\", \"priority\":3}]}, \"synonyms\":{}}");

