	add("prodigy", "{\"term\":\"prodigy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027prodige\u0027 (lang\u003denm) from Latin \u0027prōdigium\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An extraordinary thing seen as an omen; a portent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, \u0027Religion and the Decline of Magic\u0027, Folio Society 2012, p. 87\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"John Foxe believed that special \u0027\u0027prodigies\u0027\u0027 had heralded the Reformation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An extraordinary occurrence or creature; an anomaly, especially a monster; a freak\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An amazing or marvellous thing; a wonder\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A wonderful example of something\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An extremely talented person, especially a child\", \"priority\":7}]}, \"synonyms\":{}}");

