	add("produce", "{\"term\":\"produce\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{PIE root|en|dewk}}From Latin {{m|la|produco||I lead forth or forward, bring forward, draw or stretch out, extend, prolong, conduct, etc., bring forth, bear, etc.}}, from {{m|la|pro||forth, forward}} + {{m|la|duco||I lead, bring}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Items produced\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Amount produced\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Harvested agricultural goods collectively, especially vegetables and fruit, but possibly including eggs, dairy products and meat; the saleable food products of farms\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1852\u0027\u0027, F. Lancelott, \u0027Australia As It Is: Its Settlements, Farms and Gold Fields\u0027, [http://books.google.com.au/books?id\u003dyYR0R8ts3joC\u0026amp;pg\u003dPA151\u0026amp;dq\u003d%22produce%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d3KXuT4aiLMqYiAe-hsmFDQ\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22produce%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 151\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"All fruits, vegetables, and dairy and poultry-yard \u0027\u0027produce\u0027\u0027 are, in the Australian capitals, dear, and of very easy sale\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1861\u0027\u0027, William Westgarth, \u0027Australia: Its Rise, Progress, and Present Condition\u0027, [http://books.google.com.au/books?id\u003dORAOAAAAYAAJ\u0026amp;pg\u003dPA54\u0026amp;dq\u003d%22produce%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dlrnuT_jQIY2tiQfToI2JDQ\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22produce%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 54\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Taking a retrospect, then, of fourteen years preceding 1860, and making two periods of seven years each, the value of the exports of the \u0027\u0027produce\u0027\u0027 or manufactures of this country to Australia has been, for the annual average of the first seven years, 1846-52, 2½ millions sterling; while for the second period, 1856-59, the annual average has been 11 millions\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Bruce Brown, Malcolm McKinnon, \u0027New Zealand in World Affairs, 1972-1990\u0027, [http://books.google.com.au/books?id\u003d-pRHIw8R0-kC\u0026amp;pg\u003dPA291\u0026amp;dq\u003d%22produce%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d3KXuT4aiLMqYiAe-hsmFDQ\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22produce%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 291\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"While it is true that New Zealand′s economic stake in the region [of Oceania] remained relatively small when compared with the major markets for New Zealand \u0027\u0027produce\u0027\u0027 in Australia, Asia, North America and Europe, it nevertheless remained the region through which trade must pass on its way to these larger markets\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Peter Newman, Isabella Jennings, \u0027Cities As Sustainable Ecosystems: Principles and Practices\u0027, [http://books.google.com.au/books?id\u003dDpgOH9QjFY4C\u0026amp;pg\u003dPA230\u0026amp;dq\u003d%22produce%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dlrnuT_jQIY2tiQfToI2JDQ\u0026amp;redir_esc\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22produce%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 230\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A farm supervisor is employed to coordinate the planting and harvesting of \u0027\u0027produce\u0027\u0027 by volunteers\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Offspring\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Livestock and pet food supplies\", \"priority\":17}]}, \"synonyms\":{}}");

	add("product", "{\"term\":\"product\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{PIE root|en|dewk}}Latin \u0027prōductus\u0027 perfect participle of \u0027prōdūcō\u0027 first attested in English in the mathematics sense.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A commodity offered for sale\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any preparation to be applied to the hair, skin, nails, etc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Anything that is produced; a result\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1608-1674\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027product\u0027\u0027 of those ill-mated marriages\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1729-1797\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"These institutions are the \u0027\u0027products\u0027\u0027 of enthusiasm\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/books-and-arts/21604535-real-sir-isaac-newton-was-not-first-king-reason-last Magician’s passage\u003dThe truth is that [Isaac] Newton was very much a \u0027\u0027product\u0027\u0027 of his time. The colossus of science was not the first king of reason, Keynes wrote after reading Newton’s unpublished manuscripts. Instead “he was the last of the magicians”\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The amount of an artifact that has been created by someone or some process\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A consequence of someone\u0027s efforts or of a particular set of circumstances\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A chemical substance formed as a result of a chemical reaction\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A quantity obtained by multiplication of two or more numbers\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Any operation or a result thereof which generalises multiplication of numbers, like the multiplicative operation in a ring, product product of types or a categorical product\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Any tangible or intangible good or service that is a result of a process and that is intended for delivery to a customer or end user\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Illegal drugs, especially cocaine, when viewed as a commodity\", \"priority\":15}]}, \"synonyms\":{}}");

