	add("profanation", "{\"term\":\"profanation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027prophanation\u0027 \u0027profanation\u0027 and its source, \u0027\u0027 from the participle stem of Latin \u0027profānāre\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of profaning; desecration, blasphemous behaviour, defilement\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.37\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"those which mocke and condemne it, intend neverthelesse to wrong this noble vertue; but onely to condemne the abuse and \u0027\u0027profanation\u0027\u0027 of so sacred a title\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1826-06\u0027\u0027, \u0027The Gentleman\u0027s Magazine\u0027, page 528\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"but there is a time and a season for all things, and we look upon such attempts as that before us, with a certain portion of respect for a good intention, but as a lamentable want of judgment and good taste, not to speak of a familiarity with the phraseology of Scripture, little short of \u0027\u0027profanation\", \"priority\":5}]}, \"synonyms\":{}}");

	add("profaneness", "{\"term\":\"profaneness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|profane|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being profane; profanity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("profaner", "{\"term\":\"profaner\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who profanes. A person who desecrates or defiles\", \"priority\":1}]}, \"synonyms\":{}}");

	add("profanity", "{\"term\":\"profanity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|profane|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being profane\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Obscene, lewd or abusive language\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.guardian.co.uk/books/2013/may/23/holy-shit-history-swearing-mohr Where the profound meets the passage\u003dSwearing doesn\u0027t just mean what we now understand by \u0026quot;dirty words\u0026quot;. It is entwined, in social and linguistic history, with the other sort of swearing: vows and oaths. Consider for a moment the origins of almost any word we have for bad language – \u0026quot;\u0027\u0027profanity\u0027\u0027\u0026quot;, \u0026quot;curses\u0026quot;, \u0026quot;oaths\u0026quot; and \u0026quot;swearing\u0026quot; itself\", \"priority\":3}]}, \"synonyms\":{}}");

