	add("profenamine", "{\"term\":\"profenamine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A phenothiazine derivative used as an antiparkinsonian agent\", \"priority\":1}]}, \"synonyms\":{}}");

	add("professional", "{\"term\":\"professional\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|professió|al|lang\u003dca}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who belongs to a professio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who earns his living from a specified activit\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An expert\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1934\u0027\u0027, w:Rex Rex Stout, w:Fer-de-Lance \u0027Fer-de-Lance\u0027, 1992 w:Bantam Bantam edition, ISBN 0553278193, page 97\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I have learned that there is a person attached to a golf club called a \u0027\u0027professional\u0027\u0027. Find out who fills that post at the Green Meadow Club; invite the \u0027\u0027professional\u0027\u0027, urgently, to dine with us this evening\", \"priority\":5}]}, \"synonyms\":{}}");

	add("professionalism", "{\"term\":\"professionalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|professional|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The status, methods, character or standards expected of a professional or of a professional organization, such as reliability, discretion, evenhandedness, and fair play\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The use of professionals rather than amateurs in any sport etc\", \"priority\":2}]}, \"synonyms\":{}}");

	add("professionality", "{\"term\":\"professionality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|professional|ity|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being professional\", \"priority\":1}]}, \"synonyms\":{}}");

