	add("proffer", "{\"term\":\"proffer\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027lang\u003denm\u0027 from Old french (842-ca. 1400) \u0027lang\u003dfro\u0027 from Latin \u0027lang\u003dla|proferre\u0027 () from \u0027lang\u003dla|pro\u0027 () + \u0027lang\u003dla|ferre\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An offer made; something proposed for acceptance by another; a tender; as, proffers of peace or friendship\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Essay; attempt\", \"priority\":2}]}, \"synonyms\":{}}");

	add("profiler", "{\"term\":\"profiler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|profile|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mechanical device that cuts complex, irregular shapes by tracing a pattern\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who creates a profile for something or someone, especially a psychological profile for an unknown criminal\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A software program that measures the performance of different portions of another program in order to locate bottlenecks\", \"priority\":3}]}, \"synonyms\":{}}");

	add("profiteer", "{\"term\":\"profiteer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|profit|eer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who makes an unreasonable profit not justified by cost or risk\", \"priority\":1}]}, \"synonyms\":{}}");

	add("profiterole", "{\"term\":\"profiterole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small, hollow case of choux pastry with a filling\", \"priority\":1}]}, \"synonyms\":{}}");

	add("profligacy", "{\"term\":\"profligacy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027profligate\u0027 + \u0027-y\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Careless wastefulness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"No question has arisen within the records of history that pressed with the importance of the present.whether man shall inherit his rights, and universal civilisation take place? Whether the fruits of his labours shall be enjoyed by himself or consumed by the \u0027\u0027profligacy\u0027\u0027 of governments\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Shameless and immoral behaviour\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He had, indeed, reduced several women to a state of utter \u0027\u0027profligacy\u0027\u0027, had broke the hearts of some, and had the honour of occasioning the violent death of one poor girl, who had either drowned herself, or, what was rather more probable, had been drowned by him\", \"priority\":4}]}, \"synonyms\":{}}");

	add("profligateness", "{\"term\":\"profligateness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|profligate|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being profligate; wastefulness\", \"priority\":1}]}, \"synonyms\":{}}");

	add("profound", "{\"term\":\"profound\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"Late Anglo-norman \u0027profound\u0027 from Old french (842-ca. 1400) \u0027profont\u0027 from Latin \u0027profundus\u0027 from \u0027pro\u0027 + \u0027fundus\u0027 (bottom; foundation)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The deep; the sea; the ocean\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1638\u0027\u0027, w:George George Sandys, \u0027A Paraphrase vpon the Divine Poems\u0027, [http://quod.lib.umich.edu/e/eebo/A11474.0001.001/1:16.1?rgn\u003ddiv2;view\u003dfulltext Exodvs 15\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"God, in the fathomlesse \u0027\u0027profound\u0027\u0027 / Hath all his choice Commanders drown\u0027d\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An abyss\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1674\u0027\u0027, w:John John Milton, s:Paradise Lost (1674)/Book \u0027Paradise Lost (Book II)\u0027, 976-980\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"if some other place, / From your dominion won, th\u0027 Ethereal King / Possesses lately, thither to arrive / travel this \u0027\u0027profound\u0027\u0027. Direct my course\", \"priority\":6}]}, \"synonyms\":{}}");

	add("progenitiveness", "{\"term\":\"progenitiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Latin \u0027pro-\u0027 (for) + \u0027genitive\u0027 + \u0027-ness\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the condition of being able to produce offspring\", \"priority\":1}]}, \"synonyms\":{}}");

	add("progenitor", "{\"term\":\"progenitor\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Middle french (ca. 1400-1600) \u0027progeniteur\u0027 (Modern French \u0027progéniteur\u0027 , from Latin \u0027progenitor\u0027 from \u0027progenitus\u0027 perfect participle of \u0027progignere\u0027 (to beget) itself from \u0027pro-\u0027 (forth) + \u0027gignere\u0027 (to beget)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A forefather, any of a person\u0027s direct ancestors\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An individual from whom one or more people (dynasty, tribe, nation...) are descended\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Abraham alias Ibrahim is the \u0027\u0027progenitor\u0027\u0027 of both the Jewish and Arab peoples\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An ancestral form of a specie\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A predecessor of something, especially if also a precursor or model\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"ARPANET was the \u0027\u0027progenitor\u0027\u0027 of the Internet\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Someone who originates something\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A founder\", \"priority\":8}]}, \"synonyms\":{}}");

	add("progerin", "{\"term\":\"progerin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|progeria|in|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A truncated version of the protein lamin A, involved in progeria\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prognoses", "{\"term\":\"prognoses\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Category:English irregular plurals ending in \u0026quot;-es\u0026quot\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prognosis", "{\"term\":\"prognosis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{borrowing|la|prognōsis|lang\u003den}}, from Ancient greek (to 1453) \u0027πρόγνωσις\u0027 (foreknowledge, perceiving beforehand, prediction) from prefix \u0027προ-\u0027 (before) + \u0027γνῶσις\u0027 (inquiry, investigation, knowing) from \u0027γιγνώσκω\u0027 (know) First attested in the mid 17th century.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A forecast of the future course of a disease or disorder, based on medical knowledge\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1861,\u0027\u0027 John Neill, Francis Gurney Smith, \u0027An Analytical Compendium of the Various Branches of Medical Science\u0027, Blanchard and Lea, page 858\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027prognosis\u0027\u0027 is unfavourable when the child is very young, when the eruption appears before the third day, or when it suddenly disappears\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1987,\u0027\u0027 Constance S. Kirkpatrick, \u0027Nurses\u0027 Guide to Cancer Care\u0027, Rowman and Littlefield, ISBN 0847675009, page 132\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Once the patient has worked through the stage of grieving at diagnosis, adjustment may be successful as therapy is begun and a \u0027\u0027prognosis\u0027\u0027 is determined\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A forecast of the future course, or outcome, of a situation; a prediction\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008,\u0027\u0027 Paul Fairfield, \u0027Why Democracy?\u0027, SUNY Press, ISBN 0791473155, page 123\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"If free speech is the lifeblood of democracy then the fate and the \u0027\u0027prognosis\u0027\u0027 of the latter are that of the former\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2000,\u0027\u0027 Guy R. Woolley, J. J. J. M. Goumans, P. J. Wainwright, \u0027Waste Materials in Construction\u0027, Elsevier, ISBN 0080437907, page 19\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027prognosis\u0027\u0027 was made by taking into consideration the facts that the analog concrete had already achieved its ultimate strength by the period of 1500 days while concrete being predicted was to gain its strength limit by 1.25 time faster, that is by the period of 100 days\", \"priority\":10}]}, \"synonyms\":{}}");

	add("prognostication", "{\"term\":\"prognostication\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027pronosticacion\u0027 from \u0027prognosticatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A statement about or prior knowledge of the future\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1837\u0027\u0027, \u0027The Dublin University Magazine\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"She could have joined most comfortably in all their supposings, and suspicions, and doubts, and \u0027\u0027prognostications\u0027\u0027, but the honour of the family was too nearly concerned to allow free reins to her tongue\", \"priority\":3}]}, \"synonyms\":{}}");

	add("program", "{\"term\":\"program\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027programme\u0027 from \u0027programma\u0027 (a proclamation, edict) from Ancient greek (to 1453) \u0027πρόγραμμα\u0027 (a written public notice, an edict) from \u0027προγράφω\u0027 (i set forth as a public notice) from \u0027πρό\u0027 (before) + \u0027γράφω\u0027 (i write)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A set of structured activities\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A leaflet listing information about a play, game or other activity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A performance of a show or other broadcast on radio or television\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A software application, or a collection of software applications, designed to perform a specific task\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A particular mindset or method of doing things\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"lt;small\u0026gt;Ellis:\u0026lt;/small\u0026gt; Come on, John, why don’t you get with the \u0027\u0027program\u0027\u0027 and tell him where the detonators are\", \"priority\":6}]}, \"synonyms\":{}}");

	add("programmer", "{\"term\":\"programmer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|program}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who writes computer programs; a software developer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who decides which programs will be shown on a television station, or which songs will be played on a radio station\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A device that installs a software program into some other machine\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Peter Spasov, \u0027Microcontroller technology, the 68HC11‎\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The EPROM \u0027\u0027programmer\u0027\u0027 burns the data into the EPROM chip. When programming is completed, remove the EPROM chip and plug it into the circuit\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A short film feature as part of a longer film program, a \u0026quot;B-movie\u0026quot; (now rare\", \"priority\":6}]}, \"synonyms\":{}}");

	add("programming", "{\"term\":\"programming\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The designing, scheduling or planning of a radio or television program / programme\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"brain-washin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of writing a computer program\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The software that controls a machine, or the logic or expressed in such software; operating instructions\", \"priority\":4}]}, \"synonyms\":{}}");

	add("progressist", "{\"term\":\"progressist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|progress|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who makes or supports progress; a progressionist\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1849\u0027\u0027, Charlotte Brontë, \u0027Shirley\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Gérard Moore, in his double character of semi-foreigner and thoroughgoing progressist, the man most abominated\", \"priority\":3}]}, \"synonyms\":{}}");

	add("progressiveness", "{\"term\":\"progressiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|progressive|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being progressive\", \"priority\":1}]}, \"synonyms\":{}}");

	add("progressivism", "{\"term\":\"progressivism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|progressive|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A political ideology that favours progress towards better conditions in society\", \"priority\":1}]}, \"synonyms\":{}}");

	add("progressivity", "{\"term\":\"progressivity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|progressive|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being progressive\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proguanil", "{\"term\":\"proguanil\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A prophylactic antimalarial drug effective against sporozoites\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prohibitedness", "{\"term\":\"prohibitedness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|prohibited|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being prohibited\", \"priority\":1}]}, \"synonyms\":{}}");

	add("projectile", "{\"term\":\"projectile\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027prōiectilis\u0027 (projectile) from Latin \u0027prōiectus\u0027 () perfect passive participle of \u0027prōiciō\u0027 (throw forth; extend; expel)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an object intended to be or having been fired from a weapon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"any object propelled through space by the application of a force\", \"priority\":2}]}, \"synonyms\":{}}");

	add("projection", "{\"term\":\"projection\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"French\", \"middle french (ca. 1400-1600)\", \"Italian\", \"Latin\"], \"text\":\"From either the Middle french (ca. 1400-1600) \u0027projection\u0027 or its etymon, the Classical Latin \u0027prōiectiō\u0027 (stem: \u0027\u0027 (prōiectiōn-) , from \u0027prōiciō\u0027 Compare the Modern French \u0027projection\u0027 the German \u0027projektion\u0027 and the Italian \u0027proiezione\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something which projects, protrudes, juts out, sticks out, or stands out\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The face of the cliff had many \u0027\u0027projections\u0027\u0027 which are big enough for birds to nest on\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The action of projecting or throwing or propelling something\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The display of an image by devices such as movie projector, video projector, overhead projector or slide projector\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A forecast or prognosis obtained by extrapolatio\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A belief or assumption that others have similar thoughts and experiences as onesel\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The image that a translucent object casts onto another object\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Any of several systems of intersecting lines that allow the curved surface of the earth to be represented on a flat surface. The set of mathematics used to calculate coordinate positions\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An image of an object on a surface of fewer dimensions\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"An idempotent linear transformation which maps vectors from a vector space onto a subspace\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A transformation which extracts a fragment of a mathematical object\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A morphism from a categorical product to one of its (two) components\", \"priority\":12}]}, \"synonyms\":{}}");

	add("prole", "{\"term\":\"prole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027proletariat\u0027 (lang\u003den) by shortening\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of the proletaria\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A pleb (ordinary person\", \"priority\":2}]}, \"synonyms\":{}}");

	add("prolactin", "{\"term\":\"prolactin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A peptide gonadotrophic hormone secreted by the pituitary gland; it stimulates growth of the mammary glands and lactation in females\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prolactinoma", "{\"term\":\"prolactinoma\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|prolactin|oma|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A benign tumour (adenoma) of the pituitary gland\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prolation", "{\"term\":\"prolation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Latin \u0027prolationem\u0027, from the past participle stem of \u0027proferre\u0027 ‘bring forward, produce’.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Speaking, utterance, the producing of words or speech\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The relative time value of a minim to a semibreve in medieval music\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Production, bringing forth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The production or emission of the logos or divine word\", \"priority\":4}]}, \"synonyms\":{}}");

	add("prolepsis", "{\"term\":\"prolepsis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027prolepsis\u0027 () from Ancient greek (to 1453) \u0027πρόληψις\u0027 (lang\u003dgrc) from \u0027προλαμβάνω\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The assignment of something to a period of time that precedes it\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The anticipation of an objection to an argument\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A construction that consists of placing an element in a syntactic unit before that to which it would logically correspond\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A so-called \u0026quot;preconception\u0026quot;, i.e. a pre-theoretical notion which can lead to true knowledge of the world\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Growth in which lateral branches develop from a lateral meristem, after the formation of a bud or following a period of dormancy, when the lateral meristem is split from a terminal meristem\", \"priority\":5}]}, \"synonyms\":{}}");

	add("proletarianism", "{\"term\":\"proletarianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|proletarian|ism|lang\u003den}}; compare \u0027prolétairism\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The political character and practice of the proletariat; advocacy or advancement of the proletariat’s interests\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state, quality, or condition of being a proletarian\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A proletarian word or turn of phrase; a vulgarism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, \u0027Flying\u0027, volume 92, [http://books.google.co.uk/books?id\u003dmzpWAAAAMAAJ\u0026amp;q\u003d%2Bproletarianisms\u0026amp;dq\u003d%2Bproletarianisms\u0026amp;hl\u003den\u0026amp;ei\u003d1wUGTYDuDYnMswaO9vGICg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CDcQ6AEwAw page 8\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The scatological \u0027\u0027proletarianisms\u0027\u0027 of Don Jonz reflect poorly on your heretofore high level of editorial standards\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Thomas Burns McArthur (editor), \u0027The Oxford Companion to the English language\u0027, [http://books.google.co.uk/books?id\u003d8WBqAAAAMAAJ\u0026amp;q\u003d%2Bproletarianisms\u0026amp;dq\u003d%2Bproletarianisms\u0026amp;hl\u003den\u0026amp;ei\u003d1wUGTYDuDYnMswaO9vGICg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d9\u0026amp;ved\u003d0CEoQ6AEwCA page 553\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"There is a fine dividing line between the everyday sensationalism of popular and tabloid journalism and the parodies in such publications as the British satirical magazine \u0027Private Eye\u0027, which uses \u0027\u0027proletarianisms\u0027\u0027 in such headlines as \u0027The Royals, dontcha lovem\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, w:John Sutherland John Sutherland, [http://books.google.co.uk/books?id\u003dW-xb9TCvf6sC\u0026amp;pg\u003dPT27\u0026amp;dq\u003d%2Bproletarianisms\u0026amp;hl\u003den\u0026amp;ei\u003d1wUGTYDuDYnMswaO9vGICg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CCgQ6AEwA\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%2Bproletarianisms\u0026amp;f\u003dfalse biographical note] to w:H. G. H. G. Wells’ \u0027w:The History of Mr The History of Mr Polly\u0027 (Penguin Classics\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Sadly, even the ‘genteel’ \u0027\u0027proletarianisms\u0027\u0027 of Polly and his class are nowadays only normally heard among citizens over the age of fifty. In a few years that richly nuanced dialect will be as dead as Sanskrit\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Proletarians regarded as a class; the proletariat\", \"priority\":11}]}, \"synonyms\":{}}");

	add("prolicide", "{\"term\":\"prolicide\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027proles\u0027 (offspring) + \u0027caedere\u0027 (kill) Equivalent to {{suffix||cide|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The crime of destroying one\u0027s offspring, either in the womb or after birth\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prolixity", "{\"term\":\"prolixity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027prolixite\u0027 Surface etymology is {{suffix|prolix|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"long-windedness, an excess of word\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prologist", "{\"term\":\"prologist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|prologize|ist|alt1\u003dprolog(ize)|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The or of a\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1716\u0027\u0027, M. Davies, \u0027Athen. Brit.\u0027 III: \u0027Diss. Drama\u0027, page 5\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The following Play…The \u0027\u0027Prologist\u0027\u0027 and Epilogist represent the whole Course of Literature\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1828\u0027\u0027, d’Israeli, \u0027Chas. I\u0027, volume I, chapter xii, page 326\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Such a \u0027\u0027prologist\u0027\u0027 as Sir Dudley seemed scarcely to threaten\", \"priority\":5}]}, \"synonyms\":{}}");

	add("prolotherapy", "{\"term\":\"prolotherapy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The injection of an otherwise non-pharmacological and non-active irritant solution into the body, generally in the region of tendons or ligaments for the purpose of strengthening weakened connective tissue and alleviating musculoskeletal pain\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prolyl", "{\"term\":\"prolyl\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The univalent radical derived from proline\", \"priority\":1}]}, \"synonyms\":{}}");

	add("promo", "{\"term\":\"promo\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027lang\u003dla|prō\u0027 () + \u0027lang\u003dla|emō\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an interview or monologue intended to promote a character or an upcoming match\", \"priority\":1}]}, \"synonyms\":{}}");

	add("promethazine", "{\"term\":\"promethazine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A first-generation H1 receptor antagonist, antihistamine and antiemetic medication with strong sedative effects\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prometheus", "{\"term\":\"prometheus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027προμηθεύς\u0027 from \u0027πρό\u0027 (before) + \u0027μήδεα\u0027 (thoughts, ruses, concerns)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Titan chiefly honored for stealing fire from Zeus in the stalk of a fennel plant and giving it to mortals for their use. The god of fire and craft\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A moon of the planet Saturn\", \"priority\":2}]}, \"synonyms\":{}}");

	add("promil", "{\"term\":\"promil\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Parts per thousand\", \"priority\":1}]}, \"synonyms\":{}}");

	add("promiscuousness", "{\"term\":\"promiscuousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|promiscuous|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being promiscuous\", \"priority\":1}]}, \"synonyms\":{}}");

	add("promise", "{\"term\":\"promise\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027promis\u0027 (promis, promisse) from Old french (842-ca. 1400) \u0027promesse\u0027 from \u0027\u0027 Latin \u0027promissum\u0027 (a promise) feminine and neuter of Latin \u0027promissus\u0027 past participle of \u0027promittere\u0027 () from \u0027pro\u0027 () + \u0027mittere\u0027 () see mission. Compare admit, commit, permit, etc. Displaced native Middle english (1100-1500) \u0027bihest\u0027 (from Old english (ca. 450-1100) {{m|ang|behǣs||promise, vow}}), Middle english (1100-1500) \u0027hight\u0027 (promise) (from Old english (ca. 450-1100) {{m|ang|hēht}}, past tense of Old english (ca. 450-1100) {{m|ang|hātan||to promise}}), Middle english (1100-1500) \u0027hat\u0027 (from Old english (ca. 450-1100) {{m|ang|ġehāt||promise, vow}}), Middle english (1100-1500) \u0027cwide\u0027 Compare Middle english (1100-1500) \u0027forhaten\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An oath or affirmation; a vow\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A transaction between two persons whereby the first person undertakes in the future to render some service or gift to the second person or devotes something valuable now and here to his use\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1668\u0027\u0027 July 3rd, w:James Dalrymple, 1st Viscount of James Dalrymple, “Thomas Rue \u0027contra\u0027 Andrew Houſtoun” in \u0027The Deciſions of the Lords of Council \u0026amp; Seſſion\u0027 I (Edinburgh, 1683), \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003d7ApBAAAAcAAJ\u0026amp;pg\u003dPA548\u0026amp;dq\u003d%22correus%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dBFYCT56sNs7Z8QOstrGlAQ\u0026amp;ved\u003d0CHAQ6AEwC\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22correus%22\u0026amp;f\u003dfalse pages 547–548]\u0026lt;/span\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He purſued \u0027Andrew Houſtoun\u0027 upon his \u0027\u0027promiſe\u0027\u0027, to give him the like Sallary for the next year, and in ab\u0026lt;!-- page break at this point in source --\u0026gt;ſence obtained him to be holden as confeſt and Decerned\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Reason to expect improvement or success; potential\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"My native country was full of youthful \u0027\u0027promise\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"title\u003d|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe original family who had begun to build a palace to rival Nonesuch had died out before they had put up little more than the gateway, so that the actual structure which had come down to posterity retained the secret magic of a \u0027\u0027promise\u0027\u0027 rather than the overpowering splendour of a great architectural achievement\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A placeholder object that can be manipulated in code before it has been assigned a value\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Bestowal or fulfillment of what is promised\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Bible, Acts i\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"He commanded them that they should not depart from Jerusalem, but wait for the \u0027\u0027promise\u0027\u0027 of the Father\", \"priority\":12}]}, \"synonyms\":{}}");

	add("promisee", "{\"term\":\"promisee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|promise|ee|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who receives a promise\", \"priority\":1}]}, \"synonyms\":{}}");

	add("promiser", "{\"term\":\"promiser\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|promise|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who promises, one who makes promises\", \"priority\":1}]}, \"synonyms\":{}}");

	add("promonocyte", "{\"term\":\"promonocyte\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|pro|monocyte|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cell, arising from a monoblast, that develops into a monocyte\", \"priority\":1}]}, \"synonyms\":{}}");

	add("promontory", "{\"term\":\"promontory\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{attention|la}} {{m|la|promontorium}}, which is said to be derived from either {{m|la|mons||mountain}} or {{m|la|munctor||nose}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A high point of land extending into a body of water, headland; cliff\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A projecting part of the body\", \"priority\":2}]}, \"synonyms\":{}}");

	add("promorphology", "{\"term\":\"promorphology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pro|morphology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"crystallography of organic forms; a division of morphology relating to a mathematical conception of organic forms\", \"priority\":1}]}, \"synonyms\":{}}");

	add("promoter", "{\"term\":\"promoter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who promotes, particularly with respect to entertainment events or goods\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The section of DNA that controls the initiation of RNA transcription as a product of a gene\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An accelerator of catalysis that is not itself a catalyst\", \"priority\":3}]}, \"synonyms\":{}}");

	add("promptness", "{\"term\":\"promptness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|prompt|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The habit or characteristic of doing things without delay\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The habit of adhering to a designated time\", \"priority\":2}]}, \"synonyms\":{}}");

	add("promulgation", "{\"term\":\"promulgation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) {{m|frm|promulgation}}, from Latin {{m|la|prōmulgātiō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of promulgating or announcing something, especially a proclamation announcing a new law\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prong", "{\"term\":\"prong\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle low german\", \"ancient greek (to 1453)\", \"Lithuanian\", \"Latvian\"], \"text\":\"From Middle english (1100-1500) \u0027pronge\u0027 perhaps from Middle low german \u0027prange\u0027 (stick, restraining device) from \u0027prangen\u0027 () from Proto-indo-european {{m|ine-pro|*(s)preng||to wrap up, constrict}}, akin to Lithuanian \u0027springstù\u0027 (to choke, become choked or obstructed) Latvian \u0027sprañgât\u0027 (cord, constrict) Ancient greek (to 1453) \u0027σπαργανόω\u0027 (to swaddle) \u0027σπάργανον\u0027 (swaddling cloth)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thin, pointed, projecting part\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a pitchfork with four prongs\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A branch; a fork\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the two prongs of a river\", \"priority\":4}]}, \"synonyms\":{}}");

	add("pronaos", "{\"term\":\"pronaos\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027πρόναος\u0027 (vestibule of a church)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The inner area of the portico of a Greek or Roman temple\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pronation", "{\"term\":\"pronation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027pronation\u0027 from Latin \u0027pronatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Walking on the inner edge of the foot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The action of rotating the forearm so that the palm of the hand is turned down or back\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The position of the sword hand when the palm is facing down\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pronoia", "{\"term\":\"pronoia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A belief that people conspire to do one good\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pronoun", "{\"term\":\"pronoun\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"{{prefix|pro|noun|lang\u003den}}, modeled on Middle french (ca. 1400-1600) {{m|frm|pronom}}, from Latin {{m|la|pronomen}}, itself a calque of Ancient greek (to 1453) {{m|grc|ἀντωνυμία}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of noun that refers anaphorically to another noun or noun phrase, but which cannot ordinarily be preceded by a determiner and rarely takes an attributive adjective. English examples include \u0027I, you, him, who, me, my, each other\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Nicholas Brownless, \u0027Spoken Discourse in Early English Newspapers\u0027. In: Joad Raymond (ed.), News Networks in Seventeenth Century Britain and Europe, p.7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As here the possessive \u0027\u0027pronoun\u0027\u0027 \u0027our\u0027 has inclusive reference in that it a priori includes both the editor and reader, its presense amounts to a kind of pronominal bonding between writer and reader\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, N. M. Gwynne, \u0027Gwynne\u0027s Latin: The \u0027Ultimate\u0027 Introduction to Latin Including the Latin in Everyday English\u0027, Random House (ebook without page numbers) [the italic words were originally bold\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Meus\u0027 and \u0027tuus\u0027 are called \u0027adjectival \u0027\u0027pronouns\u0027\u0027\u0027 – or alternatively \u0027possessive adjectives\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027, Murray Shukyn \u0026amp; Achim K. Krull \u0026amp; Dale E. Shuttleworth, \u0027Cliffsnotes GED Test Cram Plan\u0027, 2nd edition, Houghton Mifflin Harcourt Publishing Company, p.14\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Pronouns\u0027\u0027 must agree with the nouns they replace. If a \u0027\u0027pronoun\u0027\u0027 replaces a singular noun, it should itself be singular. For example\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I brought my fishing rod\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"My\u0027 and \u0027I\u0027 are both singular and agree with each other. If the subject were plural, it would read: \u0027We brought our fishing rods\u0027. The plural \u0027\u0027pronoun\u0027\u0027 \u0027our\u0027 agrees with the plural \u0027we\", \"priority\":9}]}, \"synonyms\":{}}");

	add("pronounceability", "{\"term\":\"pronounceability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|pronounceable|ity|lang\u003den}}, after {{m|en|-ability}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pronounceableness", "{\"term\":\"pronounceableness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|pronounceable|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pronunciation", "{\"term\":\"pronunciation\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027prononciation\u0027 from Latin \u0027pronuntiatio\u0027 noun of action from perfect passive participle \u0027pronuntiatus\u0027 from verb \u0027pronuntiare\u0027 (proclaim) from \u0027pro-\u0027 for + \u0027nuntiare\u0027 (announce)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The formal or informal way in which a word is made to sound when spoken\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"What is the \u0027\u0027pronunciation\u0027\u0027 of \u0026quot;hiccough\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The way in which the words of a language are made to sound when speaking\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"His Italian \u0027\u0027pronunciation\u0027\u0027 is terrible\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The act of pronouncing or uttering something\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1831\u0027\u0027, Thomas Oughton, ‎James Thomas Law, \u0027Forms of Ecclesiastical Law\u0027 (page 62\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The second part is the sentence, which is the judge\u0027s \u0027\u0027pronunciation\u0027\u0027 upon a cause depending between two in controversy\", \"priority\":7}]}, \"synonyms\":{}}");

	add("pronuntiatio", "{\"term\":\"pronuntiatio\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027prōnuntiō\u0027 (proclaim, announce)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the five canons of classical rhetoric: the discipline of delivering speeches\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proof", "{\"term\":\"proof\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"{{PIE root|en|bʰuH}}From Middle english (1100-1500) \u0027proof\u0027 from Old french (842-ca. 1400) \u0027prove\u0027 from {{m|la|proba||a proof}}, from Latin \u0027probare\u0027 (to prove) see prove.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An effort, process, or operation designed to establish or discover a fact or truth; an act of testing; a test; a trial\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1591\u0027\u0027, w:Edmund Edmund Spenser, \u0027Prosopopoia: or, Mother Hubbard\u0027s Tale\u0027, later also published in w:William Michael William Michael Rossetti, [http://www.archive.org/stream/humorouspoems00ross/humorouspoems00ross_djvu.txt \u0027Humorous Poems\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But the false Fox most kindly played his part\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"For whatsoever mother-wit or ar\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Could work he put in \u0027\u0027proof\u0027\u0027. No practice sly\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"No counterpoint of cunning policy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"No reach, no breach, that might him profit bring\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"But he the same did to his purpose wring\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"c. 1633\u0027\u0027, w:John Ford John Ford, \u0027w:Love\u0027s Love\u0027s Sacrifice\u0027, Act 1, Scene 1\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"France I more praise and love; you are, my lord\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Yourself for horsemanship much famed; and ther\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"You shall have many \u0027\u0027proofs\u0027\u0027 to shew your skill\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1831\u0027\u0027, w:Thomas Thomas Thomson, \u0027A System of Chemistry of Inorganic Bodies\u0027, Volume 2\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A given quantity of the spirits was poured upon a quantity of gunpowder in a dish and set on fire. If at the end of the combustion, the gunpowder continued dry enough, it took fire and exploded; but if it had been wetted by the water in the spirits, the flame of the alcohol went out without setting the powder on fire. This was called the \u0027\u0027\u0027proof\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The degree of evidence which convinces the mind of any truth or fact, and produces belief; a test by facts or arguments which induce, or tend to induce, certainty of the judgment; conclusive evidence; demonstration\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"c.1603\u0027\u0027, w:William William Shakespeare, \u0027s:The Tragedy of Othello, The Moor of The Tragedy of Othello, The Moor of Venice\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"I\u0027ll have some \u0027\u0027proof\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"1841\u0027\u0027, w:Ralph Waldo Ralph Waldo Emerson, \u0027s:The The Over-Soul\u0027 in \u0027Essays: First Series\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"It was a grand sentence of Emanuel Swedenborg, which would alone indicate the greatness of that man\u0027s perception, — \u0026quot;It is no \u0027\u0027proof\u0027\u0027 of a man\u0027s understanding to be able to confirm whatever he pleases; but to be able to discern that what is true is true, and that what is false is false, this is the mark and character of intelligence.\u0026quot\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027 October 16, w:Paul Paul Simon, \u0026quot;Proof\u0026quot; in \u0027w:The Rhythm of the The Rhythm of the Saints\u0027, w:Warner Warner Bros\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Faith, faith is an island in the setting su\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"But \u0027\u0027proof\u0027\u0027, ye\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"Proof\u0027\u0027 is the bottom line for everyon\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"The quality or state of having been proved or tried; firmness or hardness which resists impression, or doesn\u0027t yield to force; impenetrability of physical bodies\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Experience of something\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, \u0027The Faerie Queene\u0027, III.1\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"But the chaste damzell, that had never \u0027\u0027priefe\u0027\u0027 / Of such malengine and fine forgerye, / Did easely beleeve her strong extremitye\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"Firmness of mind; stability not to be shaken\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"A proof sheet; a trial impression, as from type, taken for correction or examination\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"A sequence of statements consisting of axioms, assumptions, statements already demonstrated in another proof, and statements that logically follow from previous statements in the sequence, and which concludes with a statement that is the object of the proof\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"A process for testing the accuracy of an operation performed. Compare prove, \u0027transitive verb\u0027, 5\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"Armour of excellent or tried quality, and deemed impenetrable; properly, armour of proof\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"A measure of the alcohol content of liquor. Originally, in Britain, 100 \u0027\u0027proof\u0027\u0027 was defined as 57.1% by volume (not used anymore). In the US, 100 \u0027\u0027proof\u0027\u0027 means that the alcohol content is 50% of the total volume of the liquid, and thus, absolute alcohol would be 200 \u0027\u0027proof\", \"priority\":33}]}, \"synonyms\":{}}");

