	add("propensenesse", "{\"term\":\"propensenesse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|propense|nesse|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Inclination; propensity; tendency\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1624:\u0027\u0027 John Donne, \u0027Devotions\u0027 22.57\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There is a \u0027\u0027propensnesse\u0027\u0027 to diseases in the body\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Intention; premeditation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1672:\u0027\u0027 R. McWard, \u0027English Balance\u0027 5\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"They must needs look upon the King of England, as the spring \u0026amp; source, of all that calamity they feel, or feare, and perceive his \u0027\u0027propensnesse\u0027\u0027, to ruine them\", \"priority\":6}]}, \"synonyms\":{}}");

	add("propensity", "{\"term\":\"propensity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tendency, preference, or attraction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dBats host many high-profile viruses that can infect humans, including severe acute respiratory syndrome and Ebola. A recent study explored the ecological variables that may contribute to bats’ \u0027\u0027propensity\u0027\u0027 to harbor such zoonotic diseases by comparing them with another order of common reservoir hosts: rodents\", \"priority\":2}]}, \"synonyms\":{}}");

