	add("prophecy", "{\"term\":\"prophecy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027prophecie\u0027 from Old french (842-ca. 1400) \u0027prophetie\u0027 from Latin {{m|la|prophētīa}}, from Ancient greek (to 1453) \u0027προφητεία\u0027 (prophecy) from \u0027lang\u003dgrc|προφήτης\u0027 () from \u0027lang\u003dgrc|πρό\u0027 () + \u0027lang\u003dgrc|φημί\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A prediction, especially one made by a prophet or under divine inspiration\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"French writer Nostradamus made a \u0027\u0027prophecy\u0027\u0027 in his book\", \"priority\":2}]}, \"synonyms\":{}}");

