	add("prophetess", "{\"term\":\"prophetess\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027prophetesse\u0027 from \u0027prophetissa\u0027 Surface etymology is {{suffix|prophet|ess|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female prophet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 138\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"What made matters worse was that Montanus was accompanied by female \u0027\u0027prophetesses\u0027\u0027 who spoke in states of ecstasy\", \"priority\":3}]}, \"synonyms\":{}}");

	add("propidium", "{\"term\":\"propidium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|prop|idium|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A divalent organic cation having the chemical formula C\u0026lt;sub\u0026gt;27\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;34\u0026lt;/sub\u0026gt;N\u0026lt;sub\u0026gt;4\u0026lt;/sub\u0026gt;\u0026lt;sup\u0026gt;2+\u0026lt;/sup\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("propinquity", "{\"term\":\"propinquity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027propinquité\u0027 or Latin \u0027propinquitas\u0027, from \u0027propinquus\u0027 ‘neighbouring’ (from \u0027prope\u0027 ‘near’).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Nearness or proximity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1904\u0027\u0027, w:Edith Edith Wharton, \u0026quot;\u0027The Other Two\u0027\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Some experimental spirits could not resist the diversion of throwing Varick and his former wife together, and there were those who thought he found a zest in the \u0027\u0027propinquity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027, w:Melvin M. Melvin M. Webber et al, \u0026quot;\u0027The Urban Place and the Non-Place Urban Realm\u0027\u0026quot; in \u0027Explorations into Urban Structure\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Community without \u0027\u0027propinquity\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, w:Kyril Kyril Bonfiglioli, \u0027Don\u0027t Point That Thing at Me\u0027, Penguin 2001, p. 70\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Surely, too, it would be a waste of an agent, for after several hours of \u0027\u0027propinquity\u0027\u0027 I could scarcely fail to recognise him in the future\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, w:Anthony Anthony Burgess, \u0027w:The Kingdom of the The Kingdom of the Wicked\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"There was also the question of Julius’s glandular responses to the almost daily \u0027\u0027propinquity\u0027\u0027 of his Empress, so naked under her lawn\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, w:Samuel P. Samuel P. Huntington, \u0027w:Clash of The Clash of Civilizations?\u0027 (Foreign Affairs, Summer 1993), 29\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Geographical \u0027\u0027propinquity\u0027\u0027 gives rise to conflicting territorial claims from Bosnia to Mindanao\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Affiliation or similarity\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1608\u0027\u0027, w:William William Shakespeare, \u0027w:The History of King The History of King Lear\u0027\u0026quot\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"quot;[...]Here I disclaim my all my paternal care,/\u0027\u0027Propinquity\u0027\u0027, and property of blood[...]\u0026quot\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, Ybarra v. Illinois, 444 U.S. 85, 86 (1979\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A] person\u0027s mere \u0027\u0027propinquity\u0027\u0027 to others independently suspected of criminal activity does not, without more, give rise to probable cause to search that person\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, w:Don Don DeLillo, \u0027w:Underworld (DeLillo Underworld\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Decent people out there. Russ wants to believe they are still assembled in some recognizable manner, the kindred unit at the radio, old lines and ties and \u0027\u0027propinquities\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, w:Andrew Andrew Marr (heard at the w:Leveson Leveson inquiry\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Propinquity\u0027\u0027 and corruption don\u0027t always go side by side\", \"priority\":20}]}, \"synonyms\":{}}");

	add("propiska", "{\"term\":\"propiska\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Russian\"], \"text\":\"From Russian \u0027пропи́ска\u0027 () from \u0027пропи́сывать\u0027 (write into)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a system of population control in the ex-USSR, (regional) residence permit, registratio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the stamp in the Soviet \u0027internal passport\u0027 (serving as a personal ID) with the registered address\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"domicile, place where one lives (as stated in the stamp\", \"priority\":3}]}, \"synonyms\":{}}");

	add("propitiousness", "{\"term\":\"propitiousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027propitious + -ness\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The favorable quality of strongly indicating a successful result\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proponency", "{\"term\":\"proponency\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|proponent|cy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Advocacy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proponent", "{\"term\":\"proponent\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"* From Latin \u0027proponens\u0027 present participle of \u0027prōpōnere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who supports something; an advocat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027 November 2, Ken Belson, \u0026quot;[http://www.nytimes.com/2012/11/03/sports/new-york-city-marathon-will-not-be-held-sunday.html?hp\u0026amp;_r\u003d0],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 2 November 2012)\u0026lt;/small\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Proponents\u0027\u0027 of the race — notably Mayor Michael R. Bloomberg and Mary Wittenberg, director of the marathon — said the event would provide a needed morale boost, as well as an economic one\", \"priority\":3}]}, \"synonyms\":{}}");

	add("proportionality", "{\"term\":\"proportionality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the property of being proportiona\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the principle that government action ought to be proportional to the ends achieved (e.g. the military should not be deployed to stop petty vandalism\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the degree to which something is in proportio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Which is to say that given two line segments, there is not necessarily, in some absolute sense, any third line segment whose length can be said to be the product of the first two line segments. There must be some other line segment whose length serves as the \u0026quot;unit\u0026quot;.\u0026lt;br\u0026gt;But such a \u0026quot;unit\u0026quot; is not necessary when stating that \u0026quot;the area of a rectangle is the product of the lengths of its sides\u0026quot;, right? That is because the length of a line segment is inversely proportional to the length of its measuring unit, so the product of the lengths of two line segments would be inversely proportional to the \u0027square\u0027 of the length of the measuring unit, but if the product is expressed as a line segment then the length of that line segment is inversely proportional to the length of the measuring unit. There would be a conflict between two differing \u0027\u0027proportionalities\", \"priority\":4}]}, \"synonyms\":{}}");

	add("proposal", "{\"term\":\"proposal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|propose|al|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which is proposed, or propounded for consideration or acceptance; a scheme or design; terms or conditions proposed; offer; as, to make proposals for a treaty of peace; to offer proposals for erecting a building; to make proposals of marriage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The offer by a party of what he has in view as to an intended business transaction, which, with acceptance, constitutes a contract\", \"priority\":2}]}, \"synonyms\":{}}");

	add("propoxur", "{\"term\":\"propoxur\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A carbamate derivative with the chemical formula C\u0026lt;sub\u0026gt;11\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;15\u0026lt;/sub\u0026gt;NO\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;, used as an insecticide\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proppant", "{\"term\":\"proppant\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|prop|ant|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Sand or similar particulate material suspended in water or other fluid and used in hydraulic fracturing (fracking) to keep fissures open\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, P. A. Fletcher, C. T. Montgomery, G. G. Ramos, R. J. Guillory, M. J. Francis, \u0027Optimizing hydraulic fracture length to prevent formation failure in oil and gas reservoirs\u0027, Jaak J. K. Daemen, Richard A. Schultz (editors), \u0027Rock Mechanics: Proceedings of the 35th U.S. Symposium\u0027, [http://books.google.com.au/books?id\u003d8pifyGe9BUEC\u0026amp;pg\u003dPA296\u0026amp;dq\u003d%22proppant%22%7C%22proppants%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dEEoKUcj7Bo7fkgXW_YCwBA\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22proppant%22%7C%22proppants%22\u0026amp;f\u003dfalse page 296\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The use of resin coated \u0027\u0027proppants\u0027\u0027 is an area that should increase the chance of success of fracturing for sand control by eliminating the chance for \u0027\u0027proppant\u0027\u0027 to flow out of the fracture\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Boyun Guo, William C. Lyons, Ali Ghalambor, \u0027Petroleum Production Engineering: A Computer-Assisted Approach\u0027, [http://books.google.com.au/books?id\u003dLKn-oVIHXDUC\u0026amp;pg\u003dPA259\u0026amp;dq\u003d%22proppant%22%7C%22proppants%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dEEoKUcj7Bo7fkgXW_YCwBA\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22proppant%22%7C%22proppants%22\u0026amp;f\u003dfalse page 17/259\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In general, bigger \u0027\u0027proppant\u0027\u0027 yields better permeability, but \u0027\u0027proppant\u0027\u0027 size must be checked against \u0027\u0027proppant\u0027\u0027 admittance criteria through the perforations and inside the fracture. Figure 17.9 shows permeability of various kinds of \u0027\u0027proppants\u0027\u0027 under fracture closure stress\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Jack W. Plunkett, \u0027Plunkett′s Energy Industry Almanac: 2008\u0027, [http://books.google.com.au/books?id\u003dS3iGqbgPo6wC\u0026amp;pg\u003dPT261\u0026amp;dq\u003d%22proppant%22%7C%22proppants%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dEEoKUcj7Bo7fkgXW_YCwBA\u0026amp;redir_esc\u003dy unnumbered page\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Holding an estimated 36% of the ceramic and about 6% of the general \u0027\u0027proppant\u0027\u0027 markets globally, the firm is one of the largest suppliers of this specialized product in the world. \u0027\u0027Proppants\u0027\u0027 are granular structures, such as ceramic or sand, contained in the liquids that companies use to fracture the inside of an oil or natural gas well in order to increase the flow of the hydrocarbons\", \"priority\":9}]}, \"synonyms\":{}}");

	add("propper", "{\"term\":\"propper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|prop|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who or that which props\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Sandy Jones, \u0027Guide to Baby Products\u0027 (page 58\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Baby \u0027\u0027proppers\u0027\u0027 pose dangers. The latest information on the relationship between baby positioning and SIDS has led to a multitude of new products designed to prop babies on their sides or backs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, Iris Murdoch, \u0027The Black Prince\u0027 (page 47\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I do not mean that she stood around in the road, but she moved in a world of business men, golf-club bar \u0027\u0027proppers\u0027\u0027 and night-club hounds, who certainly regarded her in this light\", \"priority\":5}]}, \"synonyms\":{}}");

	add("propraetor", "{\"term\":\"propraetor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From the Latin \u0027prōpraetor\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A magistrate of ancient Rome who governed a province after serving as a praetor in Rome\", \"priority\":1}]}, \"synonyms\":{}}");

	add("propreantepenult", "{\"term\":\"propreantepenult\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"First attested in 1893; formed as {{prefix|pro|preantepenult|lang\u003den}}; compare the earlier \u0027propreantepenultimate\u0027 (1825).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The last but four / the fifth syllable from last (of a or other ); a word’s or other utterance’s syllable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The word \u0027dis·ín·te·res·ted·ly\u0027 is stressed on the \u0027\u0027propreantepenult\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1893\u0027\u0027, Robert Irving Fulton and w:Thomas Thomas Clarkson Trueblood, \u0027Practical Elements of Elocution\u0027 (3rd ed.), \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dfRYoAAAAMAAJ\u0026amp;q\u003d%22propreantepenult%22\u0026amp;dq\u003d%22propreantepenult%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dC2tKT9GlFIW98gPVz5HADg\u0026amp;redir_esc\u003dy page 273]\u0026lt;/span\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"When the \u0027\u0027propreantepenult\u0027\u0027\u0026lt;!-- also emboldened in the source --\u0026gt; is the last strong syllable, use the Pentad\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1946\u0027\u0027, Harry Charles McKown, \u0027Home Room Guidance\u0027 (2nd ed.), \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dOgcIAAAAMAAJ\u0026amp;q\u003d%22propreantepenult%22\u0026amp;dq\u003d%22propreantepenult%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dC2tKT9GlFIW98gPVz5HADg\u0026amp;redir_esc\u003dy page 2]\u0026lt;/span\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"There was a time…when he could define onomatopoeia, \u0027\u0027propreantepenult\u0027\u0027, and give examples of dactyl and anapaest\", \"priority\":6}]}, \"synonyms\":{}}");

	add("proprietor", "{\"term\":\"proprietor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Borrowed from Latin latin|proprietor\u0027 (see below), from \u0027proprietas\u0027, \u0027property\u0027, from \u0027proprius\u0027 \u0027(one\u0027s) own\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An owner\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/united-states/21583274-new-wave-press-barons-should-not-allow-newspapers-become-niche-products-keeping Keeping the mighty passage\u003dThe \u0027[Washington] Post\u0027s\u0027 \u0027\u0027proprietor\u0027\u0027 through those turbulent [Watergate] days, Katharine Graham, held a double place in Washington’s hierarchy: at once regal Georgetown hostess and scrappy newshound, ready to hold the establishment to account. That is a very American position. British journalists shun complete respectability, feeling a duty to be ready to savage the mighty, or rummage through their bins\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A sole owner of an unincorporated business, also called a sole proprietor\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One of the owners of an unincorporated business, a partner\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One or more persons to whom a colonial territory is assigned, like a fief, including its administration\", \"priority\":5}]}, \"synonyms\":{}}");

	add("propriety", "{\"term\":\"propriety\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"Late Middle english (1100-1500) \u0027propriete\u0027 (ownership) from Anglo-norman \u0027proprietie\u0027 Middle french (ca. 1400-1600) \u0027proprieté\u0027 from Latin \u0027proprietās\u0027 Compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The particular character or essence of someone or something; individuality\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A characteristic; an attribute\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A piece of land owned by someone; someone\u0027s property\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"More generally, something owned by someone; a possession\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1723\u0027\u0027, Charles Walker, \u0027Memoirs of the Life of Sally Salisbury\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I was fearful of giving You a very sensible Disgust, in making \u0027You\u0027 seem the \u0027\u0027\u0027Propriety\u0027\u0027\u0027 of \u0027one Man\u0027, when You know Yourself \u0027ordained\u0027 for the Comfort and Refreshment of \u0027Multitudes\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The fact of possessing something; ownership\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Correct language or pronunciation\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Suitability, fitness; the quality of being appropriate\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1773\u0027\u0027, w:Oliver Oliver Goldsmith, \u0027s:She Stoops to She Stoops to Conquer\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"I find such a pleasure, sir, in obeying your commands, that I take care to observe them without ever debating their \u0027\u0027propriety\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1850\u0027\u0027, Edward Ralph May, \u0026quot;Speech on African American Suffrage\u0026quot\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Now, if we may, with \u0027\u0027propriety\u0027\u0027, refer to the people one question, why may we not, with equal \u0027\u0027propriety\u0027\u0027, refer another\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Correctness in behaviour and morals; good manners, seemliness\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1811\u0027\u0027, Sense and Sensibility\u0027, Chapter 12\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Elinor then ventured to doubt the \u0027\u0027propriety\u0027\u0027 of her receiving such a present from a man so little, or at least so lately known to her\", \"priority\":16}]}, \"synonyms\":{}}");

	add("proprioception", "{\"term\":\"proprioception\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027proprius\u0027 (one\u0027s own)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The sense of the position of parts of the body, relative to other neighbouring parts of the body\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proprochirality", "{\"term\":\"proprochirality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of prochirality in which an achiral compound is converted to a chiral one in two steps\", \"priority\":1}]}, \"synonyms\":{}}");

	add("propylamphetamine", "{\"term\":\"propylamphetamine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A psychostimulant drug and research chemical of the phenethylamine and amphetamine chemical classes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prose", "{\"term\":\"prose\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Used in English since 1330, from Old french (842-ca. 1400) {{m|fr|prose}}, the Latin word {{m|la|prōsa||straightforward}} from the term {{m|la|prōsa ōrātio||a straightforward speech- i.e. without the ornaments of verse}}. The term {{m|la|prōsa||straightforward}} is a colloquial form of {{m|la|prorsa||straight forwards}} which is the feminine form of {{m|la|prorsus||straight forwards}}, from Old latin {{m|la|prōvorsus||moving straight ahead}}, from \u0027pro-\u0027 () + \u0027vorsus\u0027 () form of {{m|la|vertō||I turn}}. Compare \u0027verse\u0027 \u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Language, particularly written language, not intended as poetry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Though known mostly for her \u0027\u0027prose\u0027\u0027, she also produced a small body of excellent poems\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"things unattempted yet in \u0027\u0027prose\u0027\u0027 or rhym\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Language which evinces little imagination or animation; dull and commonplace discourse\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A hymn with no regular meter, sometimes introduced into the Mass\", \"priority\":6}]}, \"synonyms\":{}}");

	add("prosaism", "{\"term\":\"prosaism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) prosaïsme\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A manner, quality, expression, style, phrase or word that is prosaic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proscenium", "{\"term\":\"proscenium\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027proscaenium\u0027 (in front of the scenery) from Ancient greek (to 1453) \u0027προσκήνιον\u0027 from \u0027πρό\u0027 (before) + \u0027σκηνή\u0027 (scene building)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The stage area between the curtain and the orchestra\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The stage area immediately in front of the scene building\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The row of columns at the front the scene building, at first directly behind the circular orchestra but later upon a stage\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1936\u0027\u0027, Roy C. Flickinger, \u0027The Greek Theater and Its Drama\u0027, 4th edition, page 5\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The front of the scene-building and of the parascenia came to be decorated with a row of columns, the \u0027\u0027\u0027proscenium\u0027\u0027\u0027 (\u0027πρό\u0027, \u0026quot;before\u0026quot;+\u0027σκηνή\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A proscenium arch\", \"priority\":6}]}, \"synonyms\":{}}");

	add("prosciutto", "{\"term\":\"prosciutto\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\", \"Latin\"], \"text\":\"From Italian \u0027prosciutto\u0027 from Latin \u0027perexsiccātus\u0027 perfect passive participle of \u0027perexsiccō\u0027 (dry up completely)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dry-cured ham from Italy, thinly sliced\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proscription", "{\"term\":\"proscription\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027proscripcion\u0027, from Latin \u0027prōscrīptiō\u0027 from \u0027prōscrībō\u0027 (originally \u0026quot;publish in writing\u0026quot;), from \u0027prō-\u0027 and \u0027scrībō\u0027 (write)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A prohibition\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Decree of condemnation toward one or more persons, especially in the Roman antiquity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1837\u0027\u0027, Alfred John Church and William Jackson Brodribb, \u0027s:The Annals (Tacitus)/Book Tacitus\u0027 Annals, book 1\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He was wholly unopposed, for the boldest spirits had fallen in battle, or in the \u0027\u0027proscription\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The act of proscribing, or its result\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A decree or law that prohibits\", \"priority\":6}]}, \"synonyms\":{}}");

	add("prosecution", "{\"term\":\"prosecution\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027prosecution\u0027 from \u0027prōsecutio\u0027 from Latin \u0027prōsequor\u0027 (follow, pursue) from \u0027pro-\u0027 (onward) + \u0027sequor\u0027 (follow) (English \u0027sequel\u0027 . Compare \u0027persecution\u0027 and see more at \u0027prosecute\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of prosecuting a scheme or endeavor\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The institution of legal proceedings (particularly criminal) against a person\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Such a scandal as the \u0027\u0027prosecution\u0027\u0027 of a brother for forgery—with a verdict of guilty—is a most truly horrible, deplorable, fatal thing. It takes the respectability out of a family perhaps at a critical moment, when the family is just assuming the robes of respectability:it is a black spot which all the soaps ever advertised could never wash off\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The prosecuting party\", \"priority\":4}]}, \"synonyms\":{}}");

	add("prosecutor", "{\"term\":\"prosecutor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"1590s, from \u0027prosecutor\u0027 from {{m|la|prōsequor}} (English \u0027prosecute\u0027 .\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;Surface analysis is {{suffix|prosecute|or|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lawyer who decides whether to charge a person with a crime and tries to prove in court that the person is guilty\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027prosecutor\u0027\u0027 got the witness to admit he was lying\", \"priority\":2}]}, \"synonyms\":{}}");

	add("proser", "{\"term\":\"proser\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|prose|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who writes prose\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who talks or writes tediously\", \"priority\":2}]}, \"synonyms\":{}}");

	add("proslepsis", "{\"term\":\"proslepsis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From the Ancient greek (to 1453) {{m|grc|πρόσληψις}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The pretence of passing over a subject while at the same time describing it fully\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prosody", "{\"term\":\"prosody\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027prosodie\u0027 from Latin {{m|la|prosōdia}}, from Ancient greek (to 1453) \u0027προσῳδία\u0027 (song sung to music; pronunciation of syllable) from \u0027πρός\u0027 (to) + \u0027ᾠδή\u0027 (song)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of rhythm, intonation, stress, and related attributes in speech\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The study of poetic meter; the patterns of sounds and rhythms in verse\", \"priority\":2}]}, \"synonyms\":{}}");

	add("prosoma", "{\"term\":\"prosoma\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{prefix|lang\u003den|pro|t1\u003dfront|soma|t2\u003dbody}}, from Ancient greek (to 1453) {{m|grc|σῶμα||body}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The front segment of a body which is divided into two or more segments, especially the cephalothorax of an arachnid\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Michael J. Roberts, \u0027Spiders of Britain and Northern Europe\u0027, Collins 1996, p. 12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The front part, called the cephalothorax (or prosoma), is enclosed within a relatively hard and unyielding chitinous shell\", \"priority\":3}]}, \"synonyms\":{}}");

	add("prosopagnosia", "{\"term\":\"prosopagnosia\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"ancient greek (to 1453)\"], \"text\":\"Apparently derived from the German title of a 1947 paper by neurologist w:Prosopagnosi. Overview|Joachim Bodamer describing the condition, titled \u0027Die Prosop-Agnosie\u0027, derived from Ancient greek (to 1453) \u0027lang\u003dgrc|πρόσωπον\u0027 () and \u0027ἀγνωσία\u0027 (non-knowledge)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of visual agnosia characterised by difficulty with face recognition despite intact low-level visual processing. Also known as PA\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027. \u0026quot;The extent to which this function [recognition of faces] has become specialized is revealed by a brain disorder called prospagnosia. A normal person can name someone from facial features alone, even if the features have changed substantially over the years. People with prosopagnosia are not able to make this association, but have few other neurological symptoms other than a loss of some part of the visual field.\u0026quot; \u0026amp;mdash;Robert Axelrod, \u0027The Evolution of Cooperation\u0027, p. 102\", \"priority\":2}]}, \"synonyms\":{}}");

	add("prosopamnesia", "{\"term\":\"prosopamnesia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rare neuropsychological deficit defined by an inability to remember faces\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prosoponology", "{\"term\":\"prosoponology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The collection and classification of masks.\u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prosopopesis", "{\"term\":\"prosopopesis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027πρόσωπον\u0027 (mask) introduced by French psychical researcher René Sudre, whose book \u0026quot;Parapsychology\u0026quot; (1926) was published in English by Grove Press in 1962.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sudden and profound change of an individual\u0027s personality, whether spontaneous or induced e.g. in hypnosis\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prospect", "{\"term\":\"prospect\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027prospectus\u0027, past participle of \u0027prospicere\u0027, to look forward, from \u0027pr. Latin|pro\u0027, before, forward + \u0027specere, spicere\u0027, to look, to see\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The region which the eye overlooks at one time; view; scene; outlook\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His eye discovers unaware / The goodly \u0027\u0027prospect\u0027\u0027 of some foreign land\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A picturesque or panoramic view; a landscape; hence, a sketch of a landscape\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Evely\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I went to Putney to take \u0027\u0027prospects\u0027\u0027 in crayon\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A position affording a fine view; a lookout\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1667\u0027\u0027, Milton, \u0027Paradise Lost\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Him God beholding from his \u0027\u0027prospect\u0027\u0027 high\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Relative position of the front of a building or other structure; face; relative aspect\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Bible, Ezekiel xl. 4\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Their \u0027\u0027prospect\u0027\u0027 was toward the south\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The act of looking forward; foresight; anticipation\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"John Lock\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"a very ill \u0027\u0027prospect\u0027\u0027 of a future stat\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Tillotso\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Is he a prudent man as to his temporal estate, that lays designs only for a day, without any \u0027\u0027prospect\u0027\u0027 to, or provision for, the remaining part of life\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The potential things that may come to pass, often favorable\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dThe result, therefore, of this physical inquiry is, that we find no vestige of a beginning,— no \u0027\u0027prospect\u0027\u0027 of an end\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d2|passage\u003dWe drove back to the office with some concern on my part at the \u0027\u0027prospect\u0027\u0027 of so large a case. Sunning himself on the board steps, I saw for the first time Mr. Farquhar Fenelon Cooke. He was dressed out in broad gaiters and bright tweeds, like an English tourist, and his face might have belonged to Dagon, idol of the Philistines\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d26|page\u003d19|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/2013/may/27/globalisation-is-about-taxes-too Globalisation is about taxes passage\u003dIt is time the international community faced the reality: we have an unmanageable, unfair, distortionary global tax regime. [\u0026amp;hellip;] It is the starving of the public sector which has been pivotal in America no longer being the land of opportunity – with a child\u0027s life \u0027\u0027prospects\u0027\u0027 more dependent on the income and education of its parents than in other advanced countries\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A hope; a hopeful\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"Any player whose rights are owned by a top-level professional team, but who has yet to play a game for said team\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"The fa\u0026amp;ccedil;ade of an organ\", \"priority\":24}]}, \"synonyms\":{}}");

	add("prospector", "{\"term\":\"prospector\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|prospect|or|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who explores or prospects an area in search of mineral deposits, such as gold\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prostaglandin", "{\"term\":\"prostaglandin\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\"], \"text\":\"From German {{m|de|Prostaglandin}}. Equivalent to \u0027prostate|prosta(te)\u0027 + \u0027gland\u0027 + \u0027-in\u0027. So called because it was originally believed to be secreted by the prostate.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a group of naturally occurring lipids derived from the C\u0026lt;sub\u0026gt;20\u0026lt;/sub\u0026gt; acid prostanoic acid; they have a number of physiological functions and may be considered to be hormones\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Leslie Iversen, \u0027Drugs: A Very Short Introduction\u0027 (Oxford 2001), page 51\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This enzyme generates an inflammatory mediator known as \u0027\u0027prostaglandin\u0027\u0027, which triggers pain and other aspects of inflammation\", \"priority\":3}]}, \"synonyms\":{}}");

	add("prostitute", "{\"term\":\"prostitute\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|prōstitutus}}, past participle of {{m|la|prōstituō}}, from {{prefix|pro|gloss1\u003dfor, before|statuo|alt2\u003dstatuō|gloss2\u003dto set up, to erect|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who performs sexual activity for payment, especially a woma\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I currently work as a \u0027\u0027prostitute\u0027\u0027 in order to pay off my university debts\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person who is perceived as engaging in sexual activity with many people\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A person who does, or offers to do, an activity for money, despite personal dislike or dishonour\", \"priority\":4}]}, \"synonyms\":{}}");

	add("prosultiamine", "{\"term\":\"prosultiamine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thiamine propyl disulfide, a disulfide thiamine derivative used to treat vitamin B1 deficiency\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protanopia", "{\"term\":\"protanopia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of color blindness. Involves a defect in distinguishing between red and green\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protasis", "{\"term\":\"protasis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{m|la|protasis}}, from Ancient greek (to 1453) \u0027πρότασις\u0027 from \u0027προτείνω\u0027 (put forward, tender, propose) from \u0027πρό\u0027 + \u0027τείνω\u0027 (stretch)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the first part of a play, in which the setting and characters are introduce\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027, James Joyce, \u0027Ulysses\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It doubles itself in the middle of his life, reflects itself in another, repeats itself, \u0027\u0027protasis\u0027\u0027, epitasis, catastasis, catastrophe\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the antecedent in a conditional sentenc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In, \u0026quot;\u0027I will be coming if this weather holds up\u0027\u0026quot;, \u0026quot;\u0027this weather holds up\u0027\u0026quot; is the \u0027\u0027protasis\", \"priority\":5}]}, \"synonyms\":{}}");

	add("protectability", "{\"term\":\"protectability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ability to receive protection\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protection", "{\"term\":\"protection\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) from Old french (842-ca. 1400) from stem of Latin \u0027protectio\u0027 (lang\u003dla) from \u0027protectus\u0027 past participle of \u0027protego\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of keeping (something or someone) safe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"But then I had the flintlock by me for \u0027\u0027protection\u0027\u0027. ¶ There were giants in the days when that gun was made; for surely no modern mortal could have held that mass of metal steady to his shoulder. The linen-press and a chest on the top of it formed, however, a very good gun-carriage; and, thus mounted, aim could be taken out of the window\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The state of being safe\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A means of keeping or remaining safe\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A means, such as a condom, of preventing pregnancy or sexually transmitted disease\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Coverage\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Immunity from harm obtained by illegal payments, as bribery or extortion\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Restrictions on foreign competitors which limit their ability to compete with domestic producers of goods or services\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An instance of a security token associated with a resource (such as a file\", \"priority\":9}]}, \"synonyms\":{}}");

	add("protectionism", "{\"term\":\"protectionism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027protectionnisme\u0027 Surface etymology is {{suffix|protection|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A system or policy of protecting the domestic producers of a product from foreign competition by imposing tariffs, quotas, duties or other barriers on importations\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protectress", "{\"term\":\"protectress\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|protector|ess|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female protector\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, Henry James, \u0027What Maisie Knew\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Her \u0027\u0027protectress\u0027\u0027, at this, was upon her again [...]. For the rest of the conversation she was enclosed in Mrs. Wix\u0027s arms\", \"priority\":3}]}, \"synonyms\":{}}");

	add("proteinemia", "{\"term\":\"proteinemia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The presence of protein in the blood\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proteinomics", "{\"term\":\"proteinomics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|protein|omics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The identification of the totality of the proteins in an organism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proteoliposome", "{\"term\":\"proteoliposome\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|proteo|liposome|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A liposome into which one or more proteins have been inserted, usually by artificial mean\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proteomics", "{\"term\":\"proteomics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|protein|omics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The branch of molecular biology that studies the set of proteins expressed by the genome of an organism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proteranthy", "{\"term\":\"proteranthy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being proteranthous\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proteroglyph", "{\"term\":\"proteroglyph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|protero|glyph|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any proteroglyphous snake\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proterozoic", "{\"term\":\"proterozoic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|protero|zoic|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The eon from 2,500 Ma to 541.0±1.0 Ma, the beginning of the Phanerozoic, marked by the build up of oxygen in the atmosphere and the emergence of primitive multicellular life\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protestant", "{\"term\":\"protestant\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"French\"], \"text\":\"From German {{m|de|Protestant}} or French \u0027protestant\u0027 equivalent to {{suffix|protest|ant|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of any of several Christian denominations which separated from the Roman Catholic Church based on theological or political differences during the Reformation (or sometimes later\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protestantism", "{\"term\":\"protestantism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|Protestant|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Protestant (rather than the Roman Catholic or Orthodox) Christian faith\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Collectively, the Protestant churches or the Protestants\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The beliefs held by the Protestant churches\", \"priority\":3}]}, \"synonyms\":{}}");

	add("protester", "{\"term\":\"protester\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|protest|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who protests, either singly or in a public display of group feeling\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d26|page\u003d18|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/2013/jun/02/hypocrisy-lies-at-heart-bradley-manning-trial Hypocrisy lies at heart of Manning passage\u003dThe dispatches [\u0026amp;hellip;] also exposed the blatant discrepancy between the west\u0027s professed values and actual foreign policies. Having lectured the Arab world about democracy for years, its collusion in suppressing freedom was undeniable as \u0027\u0027protesters\u0027\u0027 were met by weaponry and tear gas made in the west, employed by a military trained by westerners\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One who protests a bill of exchange, or note\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Charles Evan Stewart, \u0027Transnational Contracts\u0027 (volume 1, page 96\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027protester\u0027\u0027 must also draw up an affidavit containing the literal reproduction of the bill with its acceptance, endorsements, guarantee by endorsement (\u0026quot;aval\u0026quot;), and anything else contained in the note\", \"priority\":5}]}, \"synonyms\":{}}");

	add("proteus", "{\"term\":\"proteus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of many gram-negative bacteria, of the genus \u0027Proteus\u0027, several of which are responsible for human infections\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prothetely", "{\"term\":\"prothetely\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The abnormal development of parts of an insect larva, often as a result of abnormal conditions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protirement", "{\"term\":\"protirement\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|pro-|retirement|lang\u003den}}; coined by Arthur Godfrey, according to the article \u0027Let\u0027s Protire\u0027, \u0027The American Mercury\u0027, January 1961.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Early retirement from professional work with the positive idea of pursuing something more fulfilling\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1961.\u0027\u0027 George Jean Nathan, Henry Louis Mencken \u0027The American Mercury\u0027, p. 92\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In other words, retirement connotes regression, whereas \u0027\u0027protirement\u0027\u0027 would mean progression. ... Arthur Godfrey was right! \u0026quot;Retirement\u0026quot; is a dirty word\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, John S. Murphy, Frederic M. Hudson \u0027The Joy of Old\u0027, Geode Press, 1998, ([http://www.amazon.ca/Joy-Old-Guide-Successful-Elderhood/dp/product-description/1886851441 Amazon.Com book review\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Retire? Thats something you do to a wheel. The authors suggest \u0027\u0027Protirement\u0027\u0027 instead\", \"priority\":5}]}, \"synonyms\":{}}");

	add("protistologist", "{\"term\":\"protistologist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|protistology|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who studies protists\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protistology", "{\"term\":\"protistology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The scientific study of protists\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protoanemonin", "{\"term\":\"protoanemonin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|proto|anemonin|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A toxin found in all plants of the buttercup family (Ranunculaceae), produced by an enzymatic process from the glucoside ranunculin\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protocapitalism", "{\"term\":\"protocapitalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|proto|capitalism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any early system of trade from which modern capitalism ultimately derives\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protocol", "{\"term\":\"protocol\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027protocolle\u0027 \u0027protocole\u0027 (document, record) and its source, \u0027protocollum\u0027 () from \u0027πρωτόκολλον\u0027 (first sheet glued onto a manuscript) from \u0027πρῶτος\u0027 (first) + \u0027κόλλα\u0027 (glue)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The minutes, or official record, of a negotiation or transaction; especially a document drawn up officially which forms the legal basis for subsequent agreements based on it\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1842\u0027\u0027, Thomas Campbell, \u0027Frederick the Great and his Times\u0027, vol. II, p. 47\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Another account says that, on the morning of the 31st of May, the king delivered to the prince-royal the crown, the sceptre, and the key of his treasure and gave him his blessing. The privy-counsillor Vockerodt drew up at his desire a \u0027\u0027protocol\u0027\u0027 of the transaction\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An official record of a diplomatic meeting or negotiation; later specifically, a draft document setting out agreements to be signed into force by a subsequent formal treaty\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1970\u0027\u0027, Matthew Smith Anderson, \u0027The Great Powers and the Near East, 1774-1923\u0027, p. 32\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The terms of this \u0027\u0027protocol\u0027\u0027 formed the basis for the Treaty of London signed by the British, French and Russian governments on 6 July 1827\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An amendment to an official treaty\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Philippe Sands, \u0027Principles of International Environmental Law\u0027, p. 917 n. 253\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The 1992 \u0027\u0027Protocol\u0027\u0027 amended the definitions of other terms, including ‘ship’, ‘oil’ and ‘incident’: Art. 2\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The first leaf of a roll of papyrus, or the official mark typically found on such a page\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, Leila Avrin, \u0027Scribes, Script, and Books\u0027, p. 146\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"They marked the beginning of each scroll with their \u0027\u0027\u0027protocol\u0027\u0027\u0027, a practice that continued in the papyrus trade in the Byzantine Empire [...] into the Islamic period, when there were bilingual \u0027\u0027protocols\u0027\u0027 in Greek and Arabic\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The official formulas which appeared at the beginning or end of certain official documents such as charters, papal bulls etc\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, \u0027Archivum Historiae Pontificiae\u0027, v. 23, p. 14\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027protocol\u0027\u0027 of the bull contains elements that appear to be formulaic by the time of John XVIII \u0027s pontificate\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The original notes of observations made during an experiment; also, the precise method for carrying out or reproducing a given experiment\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"1931\u0027\u0027, Gye \u0026amp; Purdy, \u0027The Cause of Cancer\u0027, p. 194\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The following is an abstract of the \u0027\u0027protocol\u0027\u0027 of the experiment: \u0027Tumour extract.\u0027—A measured 16 c.c. of minced Rous Sarcoma tissue was ground with sand and extracted with 400 c.c. of 0.8-per-cent. saline\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The official rules and guidelines for head of heads of state and other dignitaries, governing accepted behaviour in relations with other diplomatic representatives or over affairs of state\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Laura Johnson, \u0026quot;A mwah too far\u0026quot;, \u0027The Guardian\u0027, 19 Sep 2009\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Even the Queen (for whom the curtsey is a more standard address) was recently treated to an enthusiastic Obama embrace. Her Majesty, who is not normally known for partaking in such public displays of affection, seemed unperturbed by Michelle Obama\u0027s disregard for royal \u0027\u0027protocol\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"An accepted code of conduct; acceptable behaviour in a given situation or group\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, \u0027The Guardian\u0027, 16 Jul 2010\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"For those uncertain in the \u0027\u0027protocol\u0027\u0027 of handshaking a formula for the perfect handshake has been devised by scientists at the University of Manchester\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"A set of formal rules describing how to transmit or exchange data, especially across a network\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Zheng \u0026amp; Ni, \u0027Smart Phone and Next-Generation Mobile Computing\u0027, p. 444\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"An exception is Jabber, which is designed based on an open \u0027\u0027protocol\u0027\u0027 called the extensible messaging and presence protocol (XMPP\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"The set of instructions allowing a licensed medical professional to start, modify, or stop a medical or patient care order\", \"priority\":28}]}, \"synonyms\":{}}");

	add("protoculture", "{\"term\":\"protoculture\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|proto|culture|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The passing of behaviours from one generation to another among non-human primates. These cultures are very rudimentary, and do not exhibit complex cultural technology\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protoderm", "{\"term\":\"protoderm\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|proto|derm|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the primary meristem from which the epidermis develops\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protofeminism", "{\"term\":\"protofeminism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|proto|feminism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A philosophical tradition anticipating modern feminist concepts before their arrival\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protoform", "{\"term\":\"protoform\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|proto|form|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hypothetical form of a word, reconstructed from derived words\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protogrammar", "{\"term\":\"protogrammar\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|proto|grammar|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rudimentary grammar\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protogyny", "{\"term\":\"protogyny\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition in which an organism begins life as a female and then changes into a male\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The condition of flowers whose female parts mature before the male ones\", \"priority\":2}]}, \"synonyms\":{}}");

	add("protologism", "{\"term\":\"protologism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined by {{w|Mikhail Epstein}} from {{compound|πρῶτος|t1\u003dfirst|lang1\u003dgrc|λόγος|t2\u003dword|lang2\u003dgrc|lang\u003den}}, by analogy with prototype and neologism.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A newly coined word or phrase defined in the hope that it will become common; a recently created term possibly in narrow use but not yet acknowledged\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protomartyr", "{\"term\":\"protomartyr\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|proto|martyr|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the first Christian martyrs\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protophyte", "{\"term\":\"protophyte\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|proto|phyte|t1\u003dfirst|t2\u003dplant|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various primitive organisms such as the slime molds\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protopope", "{\"term\":\"protopope\", \"etymology\":{\"influencers\":[], \"languages\":[\"Greek\", \"English\"], \"text\":\"Greek πρωτόπαπας ; see {{prefix|proto|pope|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the clergy of first rank in the lower order of secular clergy; an archpriest\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protosalt", "{\"term\":\"protosalt\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|proto|salt|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The form of a salt of a particular base / acid combination that has the lowest proportion of bas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A salt derived from a protoxide\", \"priority\":2}]}, \"synonyms\":{}}");

	add("protoscience", "{\"term\":\"protoscience\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|proto|science|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unscientific field of study which later becomes a science (e.g. astrology becoming astronomy and alchemy becoming chemistry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A field of study at the initial phase of the scientific method, involving information gathering and hypothesis formulation, but is not yet falsifiable, or if it is, its predictions have not yet been observed\", \"priority\":2}]}, \"synonyms\":{}}");

	add("protostar", "{\"term\":\"protostar\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|proto|star|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A collection of gas and dust in space with high temperature that usually grows to the point of beginning nuclear fusion and becoming a star\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protostome", "{\"term\":\"protostome\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|proto|stome|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any animal, of the former taxon \u0027Protostomia\u0027, in which the mouth is derived from the embryonic blastopore\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protosyntax", "{\"term\":\"protosyntax\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That part of syntax that omits membership\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prototroch", "{\"term\":\"prototroch\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|proto|troch|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A ciliary band in the larvae of trochophore\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prototroph", "{\"term\":\"prototroph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|proto|troph|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any microorganism that can synthesize its nutrients from inorganic material\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prototropy", "{\"term\":\"prototropy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of tautomerism in which the two forms differ only in the position of a proton; the transfer of a proton between these two forms\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prototype", "{\"term\":\"prototype\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027\u0027 (πρωτο-) + Ancient greek (to 1453) \u0027\u0027 (τύπος)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An original object or form which is a basis for other objects, forms, or for its models and generalization\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An early sample or model built to test a concept or proces\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The prototype had loose wires and rough edges, but it worked\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An instance of a category or a concept that combines its most representative attributes\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A robin is a \u0027\u0027prototype\u0027\u0027 of a bird; a penguin is not\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A declaration of a function that specifies the name, return type, and parameters but none of the body, or actual code\", \"priority\":6}]}, \"synonyms\":{}}");

	add("protozoan", "{\"term\":\"protozoan\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027protozoa\u0027 {suffix||an|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the diverse group of eukaryotes, of the phylum Protozoa, that are primarily unicellular, existing singly or aggregating into colonies, are usually nonphotosynthetic, and are often classified further into phyla according to their capacity for and means of motility, as by pseudopods, flagella, or cilia\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protriptyline", "{\"term\":\"protriptyline\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A particular tricyclic antidepressant, also used to treat ADHD\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protrudin", "{\"term\":\"protrudin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A protein that induces neurite formation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("protrusion", "{\"term\":\"protrusion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027protrusion\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of protruding\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being protruded\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Anything that protrudes\", \"priority\":3}]}, \"synonyms\":{}}");

	add("protyle", "{\"term\":\"protyle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027proto-\u0027 + Ancient greek (to 1453) \u0027ὕλη\u0027 (timber, material)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hypothetical base substance from which all chemical elements were believed to have been made; subatomic particles\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Philip Ball, \u0027The Elements: A Very Short Introduction\u0027, Oxford 2004, p. 73\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Dumas wondered whether the fundamental building blocks of atoms might be some smaller division of the hydrogen atom: a half, say, or a quarter. This basic substance became known as ‘\u0027\u0027protyle\u0027\u0027’\", \"priority\":3}]}, \"synonyms\":{}}");

	add("provel", "{\"term\":\"provel\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A white processed cheese popular in and around Saint Louis, Missouri\", \"priority\":1}]}, \"synonyms\":{}}");

	add("provenance", "{\"term\":\"provenance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From French \u0027provenance\u0027 (lang\u003dfr) from Middle french (ca. 1400-1600) \u0027provenant\u0027 () present participle of \u0027provenir\u0027 (lang\u003dfrm) from Latin \u0027provenio\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Place or source of origin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Many supermarkets display the \u0027\u0027provenance\u0027\u0027 of their food products\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The place and time of origin of some artifact or other object. See \u0027\u0027Usage note\u0027\u0027 below\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This spear is of Viking \u0027\u0027provenance\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The history of ownership of a work of ar\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The picture is of royal \u0027\u0027provenance\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The copy history of a piece of data, or the intermediate pieces of data utilized to compute a final data element, as in a database record or web site (data provenance\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The execution history of computer processes which were utilized to compute a final piece of data (process provenance\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"of a person) Background; history; place of origin; ancestry\", \"priority\":9}]}, \"synonyms\":{}}");

	add("provender", "{\"term\":\"provender\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle english (1100-1500) \u0027provendre\u0027 from Old french (842-ca. 1400) \u0027provendre\u0027 var. of \u0027provende\u0027 () from \u0027praebenda\u0027 (a payment, in {{etyl) also an allowance of food and drink, pittance, also a prebend}}; see prebend.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Food, especially for livestock\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1663\u0027\u0027, Hudibras\u0027, by w:Samuel Butler Samuel Butler, part 1, s:Hudibras/Part 1/Canto canto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He ripp\u0027d the womb up of his mother, / Dame Tellus, \u0027cause he wanted fother, / And \u0027\u0027provender\u0027\u0027, wherewith to feed / Himself and his less cruel steed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An edible material that provides sustenance\", \"priority\":4}]}, \"synonyms\":{}}");

	add("provenience", "{\"term\":\"provenience\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Alteration of \u0027provenance\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Source; origin\", \"priority\":1}]}, \"synonyms\":{}}");

	add("proverb", "{\"term\":\"proverb\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027proverbe\u0027 from Latin \u0027proverbium\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A phrase expressing a basic truth which may be applied to common situations\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A striking or paradoxical assertion; an obscure saying; an enigma; a parable\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Bible, John xvi. 2\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"His disciples said unto him, Lo, now speakest thou plainly, and speakest no \u0027\u0027proverb\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A familiar illustration; a subject of contemptuous reference\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Bible, Deuteronomy xxviii. 3\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Thou shalt become an astonishment, a \u0027\u0027proverb\u0027\u0027, and a by word, among all nations\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A drama exemplifying a proverb\", \"priority\":8}]}, \"synonyms\":{}}");

	add("proverbiality", "{\"term\":\"proverbiality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or characteristic of being proverbial\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1874\u0027\u0027, \u0026quot;English \u0027vers de société\u0027,\u0026quot; \u0027The Living Age\u0027, vol. 122, no. 1580, p. 718\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For such a quatrain and couplet as the following it is scarcely hazardous to predict \u0027\u0027proverbiality\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"They eat and drink and scheme and plod\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And go to church on Sunday\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"And many are afraid of God\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"And more of Mrs. Grundy\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The Cockney met in Middlesex or Surrey\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Is often cold and always in a hurry\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027, Shirley L. Arora, \u0026quot;Spanish Proverbial Exaggerations from California,\u0026quot; \u0027Western Folklore\u0027, vol. 27, no. 4, p. 232\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The degree of \u0027\u0027proverbiality\u0027\u0027, or currency in oral tradition, attained by these exaggerations is difficult to assess\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Rose Marie Beck, \u0026quot;Texts on Textiles: \u0027\u0027Proverbiality\u0027\u0027 as Characteristic of Equivocal Communication at the East African Coast (Swahili),\u0026quot; \u0027Journal of African Cultural Studies\u0027, vol. 17, no. 2, p. 156\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Because other aspects are also seen as contributing to \u0027\u0027proverbiality\u0027\u0027—equivocation, authoritativeness, and negotiation of power relations—a text may be proverbial to various degrees\", \"priority\":13}]}, \"synonyms\":{}}");

	add("proverbiology", "{\"term\":\"proverbiology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of proverbs; the collective lore of proverbs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1880\u0027\u0027, J. Long, \u0026quot;Proverbs: English and Keltic, with Their Eastern Relations,\u0026quot; \u0027The Folk-Lore Record\u0027, vol. 3, no. 1, p. 59\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As the English language is best studied by the light thrown on it by comparative philology, and as a knowledge of human anatomy is greatly aided by the discoveries in the comparative anatomy of animals, so must English \u0027\u0027Proverbiology\u0027\u0027 by assisted by the light reflected from comparative \u0027\u0027Proverbiology\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, R. V. Teschner, \u0026quot;Reviews of \u0027A Dictionary of Mexican American Proverbs\u0027 by Mark Glazer,\u0026quot; \u0027Hispania\u0027, vol. 72, no. 1, p. 150\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Is the DMAP [\u0027Dictionary of Mexican American Proverbs\u0027] intended as a comparative Chicano \u0027\u0027proverbiology\", \"priority\":5}]}, \"synonyms\":{}}");

	add("proviant", "{\"term\":\"proviant\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"provisions, especially for an army\", \"priority\":1}]}, \"synonyms\":{}}");

	add("providence", "{\"term\":\"providence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027providence\u0027 () Middle french (ca. 1400-1600) \u0027providence\u0027 and their source, Latin \u0027prōvidentia\u0027 (providence, foresight) from the present participle of \u0027providere\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Preparation for the future; good governance, foresight\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The careful governance and guidance of god (or another deity, nature etc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A manifestation of divine care or direction; an instance of divine intervention\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, \u0027Religion and the Decline of Magic\u0027, Folio Society 2012, p. 91\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The idea was that a complete list of fully documented \u0027\u0027providences\u0027\u0027 should be compiled as a cooperative venture which would cross denominational barriers\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Specifically, the prudent care and management of resources; thriftiness, frugality\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027providence\u0027\u0027 in saving for his old age is exemplary\", \"priority\":7}]}, \"synonyms\":{}}");

	add("providentness", "{\"term\":\"providentness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|provident|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the quality or state of being provident; carefulness; prudence; economy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("province", "{\"term\":\"province\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"gothic\", \"Latin\"], \"text\":\"From Middle english (1100-1500) {{m|enm|provynce}}, from Old french (842-ca. 1400) {{m|fro|*province}}, from Latin {{m|la|prōvincia||territory brought under Roman domination; official duty, office, charge, province}}, from Proto-indo-european {{m|ine-pro|*prōw-||right judge, master}}. Cognate with Gothic {{m|got|𐍆𐍂𐌰𐌿𐌾𐌰||lord, master}}, Old english (ca. 450-1100) {{m|ang|frēa||ruler, lord, king, master}}. See also {{l|en|frow}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A subdivision of government usually one step below the national level; one of ten of Canada\u0027s federated entities, recognized by the Constitution and having a separate representative of the Sovereign (compare territory\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A territorial area within a country\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A jurisdiction; a (literal or figurative) area of authority\", \"priority\":3}]}, \"synonyms\":{}}");

